  var usqlQuery = 'select distinct name as "User Actions",count(*) as "Requests",AVG(useraction.duration) from useraction where application in ('+appsList+') and keyuseraction="true" and starttime>='+startTime+' and endtime<='+endTime+' order by Requests DESC';
  const response = await rumUserSessionsClient.getUsqlResultAsTable({query: usqlQuery, startTimestamp: startTime, endTimestamp: endTime});
  const sampleCount = response.values.length;

  return {
    records: new Array(sampleCount).fill(null).map((_, index, array) => {
      return {
        'User Action': response.values[index][0],
        'Requests': response.values[index][1],
        'Duration': response.values[index][2]/1000,
        'Duration Reduction Goal': (response.values[index][2]/1000) - (response.values[index][2]/1000)*$PercentImprovementGoal/100,
        'Annualized Hours Saved': (response.values[index][2]/1000)*$PercentImprovementGoal/100*response.values[index][1]*365/((endTime - startTime)/24/60/60/1000),
