      };
    }),
    types: [
      {
        indexRange: [0, sampleCount],
        mappings: {
          'User Action': { type: 'string' },
          'Requests': { type: 'double' },
          'Duration': { type: 'double' },
          'Duration Reduction Goal': { type: 'double' },
          'Annualized Hours Saved': { type: 'double' },
          'Annualized Financial Improvement': { type: 'string' }
        },
      },
    ],
  };
}

