      return {
        Date: response.values[index][0],
        'Duration': response.values[index][1]/1000         
      };
    }),
    types: [
      {
        indexRange: [0, sampleCount],
        mappings: {

         Date: { type: 'timestamp' },
          'Duration': { type: 'double' }
        },
      },
    ],
  };
}

